import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Pages
import Login from './auth/LoginSignup';
import Home from './users/HomeUser';
import User from './users/User';
import Business from './users/Business';
import Charity from './users/Charity';
import Communication from './communication/Communication';
import Donations from './donation_coordination/Donations';
import Recipes from './recipe/Recipe';
import Waste from './waste_analyses/WasteAnalyses';
import Notifications from './notifications/Notification';
import ExpiryManager from './expiry_manager/ExpiryManager';
import BulkUpload from './database/BulkUpload'; // add this at the top

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentUser: null, // store full user object here
    };
  }

  handleLogin = (user) => {
    this.setState({ currentUser: user });
  };

  handleLogout = () => {
    this.setState({ currentUser: null });
  };

  renderNavbar() {
    return (
      <nav style={{ padding: 10, borderBottom: '1px solid #ddd' }}>
        <Link to="/">Home</Link> |{' '}
        <Link to="/profile">Profile</Link> |{' '}
        <Link to="/bulkupload">Bulk Upload</Link> |{' '}
        <Link to="/charity">Charity</Link> |{' '}
        <Link to="/communication">Communication</Link> |{' '}
        <Link to="/donations">Donations</Link> |{' '}
        <Link to="/recipes">Recipes</Link> |{' '}
        <Link to="/waste">Waste Analysis</Link> |{' '}
        <Link to="/notifications">Notifications</Link> |{' '}
        <Link to="/expiry">Expiry Manager</Link> |{' '}
        <button
          onClick={this.handleLogout}
          style={{
            marginLeft: 10,
            padding: '4px 8px',
            backgroundColor: '#eee',
            border: '1px solid #ccc',
            cursor: 'pointer',
          }}
        >
          Log out
        </button>
      </nav>
    );
  }

  render() {
    const { currentUser } = this.state;

    return (
      <Router>
        {!currentUser ? (
          <Login onLogin={this.handleLogin} />
        ) : (
          <div>
            {this.renderNavbar()}
            <Routes>
              <Route path="/" element={<Home currentUser={currentUser} />} />
              <Route path="/profile" element={<User currentUser={currentUser} />} />
              <Route path="/HomeUser" element={<Home currentUser={currentUser} />} />
              <Route path="/business" element={<Business currentUser={currentUser} />} />
              <Route path="/charity" element={<Charity currentUser={currentUser} />} />
              <Route path="/communication" element={<Communication currentUser={currentUser} />} />
              <Route path="/donations" element={<Donations currentUser={currentUser} />} />
              <Route path="/recipes" element={<Recipes currentUser={currentUser} />} />
              <Route path="/waste" element={<Waste currentUser={currentUser} />} />
              <Route path="/notifications" element={<Notifications currentUser={currentUser} />} />
              <Route path="/expiry" element={<ExpiryManager currentUser={currentUser} />} />
              <Route path="/bulkupload" element={<BulkUpload currentUser={currentUser} />} />
            </Routes>
          </div>
        )}
      </Router>
    );
  }
}

export default App;
